INSERT INTO `soal` VALUES ('497','12','21','Tahapan tidur jenis NREM pada tahap IV terjadi proses apa','1','Transisi antara bangun dan tidur dengan ciri relaks, masih sadar, merasa nagntuk, bola mata bergerak, frekuensi nadi dan napas menurun, dapat bangun segera selama tahap ini,  berlangsung sekitar 5 menit.\n','Tahap tidur ringan dan proses tubuh terus menurun dengan ciri mata pada umumnya menetap, denyut jantung dan frekuensi napas menurun, temperature tubuh menurun, metabolism menurun, berlangsung pendek dan berakhir 10-15 menit.\n','Tahap tidur dalam, dengan ciri kecepatan jantung dan pernapasan turun, jarang bergerak, sulit dibangunkan, gerak bola mata cepat, sekresi lambung menurun, dan tonus otot menurun.\n','Tahap tidur dengan ciri denyut nadi, frekuensi napas, dan proses tubuh lainnya lambat. Hal ini disebabkan oleh adanya dominasi sistem saraf parasimpatis sehingga sulit untuk bangun.\n','','C','','','','','','','');
