INSERT INTO `soal` VALUES ('758','20','7','Seorang perempuan berusia 23 tahun melahirkan anak pertama di bidan ani. Karena perineumnya\nkaku, bidan ani akan melakukan tindakan episiotomy. Namun si ibu menolak tindakan tersebut.\nApa yang akan dilakukan bidan selanjutnya','1','Tetap melakukan episiotomy','Mengikuti keinginan ibu untuk tidak melakukan episiotomy','Tidak melakukan episiotomy, dan meminta informed consent','Ibu merujuk pasien','','C','','','','','','','');
