INSERT INTO `soal` VALUES ('773','20','22','Adanya sala satu dari dua dorongan yang berlawanan yang baik atau yang buruk yang tidak dapat\ndipenuhi keduanya dalam satu waktu yang masing-masing menyangkut keyakinan individu yang\nberhubungan dengan perannya (bidan), disebut','1','Dilema etik','Dilema moral','Moral Issue','Issue etik','','B','','','','','','','');
INSERT INTO `soal` VALUES ('774','20','23','Seorang ibu mengalami perdarahan post partum setelah melahirkan bayinya dirumah , ibu\ntersebut menolak untuk diberikan suntikkan uterotonika. Sebagai bidan apa yang anda lakukan\nketika menghadapi masalah tersebut','1','Bidan tidak melakukan suntikkan karena menghargai hak pasien','Bidan tetap memberikan suntikkan karena pertimbangan kondisi pasien','Bidan langsung merujuk pasien kerumah sakit tanpa tindakan terlebih dahulu','Bidan meminta bantuan kepada petugas kesehatan yang lain','','B','','','','','','','');
INSERT INTO `soal` VALUES ('775','20','24','Himpunan peraturan-peraturan yang dibuat oleh penguasa Negara atau pemerintah secara resmi\nmelalui lembaga atau institusi hukum untuk mengatur tingkah laku manusia dalam\nbermasyarakat, bersifat memaksa dan memilikji sanksi yang harus dipenuhi, hal ini disebut\ndengan','1','Norma','Hukum','Pidana','Etiket, Sopan santun, Moral','','B','','','','','','','');
INSERT INTO `soal` VALUES ('776','20','25','Seorang perempuan berusia 40 tahun menderita penyakit kanker. Ibu tersebut tidak tahan lagi\nakan penyakitnya dan meminta kepada bidan/dokter untuk mengakhiri hidupnya (euthanasia).\nKasus ini adalah','1','Issu etik','Dilema etik','Konflik etik','Issu moral','','B','','','','','','','');
INSERT INTO `soal` VALUES ('777','20','26','Seorang pasien datang keklinik bersalin dengan suaminya, dari hasil pemeriksaan pasien tersebut\nsedang hamil 4 minggu, pasien mengaku mempunyai bayi yang berumur 8 bulan dan kesulitan\ndalam kondisi ekonomi. Pasien meminta untuk dilakukan aborsi terhadap bayi yang\ndikandungnya dengan alasan tersebut. Sebagai bidan keputusan apa yang anda ambil dalam\nmenghadapi kasus tersebut','1','Menyetujui permintaan pasien dan meminta informed consent','Menolak permintaan pasien karena melanggar kode etik','Menyetujui permintaan pasien dengan alasan kondisi kesehatan dan ekonomi pasien','Menolak permintaan pasien dengan alasan tidak memiliki kompetensi untuk tindakan abortus','','C','','','','','','','');
INSERT INTO `soal` VALUES ('778','20','27','Seorang perempuan berumur 33 tahun melahirkan bayi kembar yang mengalami pendempetan\ndibagian dada. Operasi pemisahan bayi berisiko tinggi karena organ jantung hanya ada satu buah,\nsehingga satu bayi harus dikorbankan. Pada kasus ini teori pengambilan keputusan apa yang\ndigunakan','1','Deontology','Hedonism','Eudemonisme','Utilitarian','','D','','','','','','','');
INSERT INTO `soal` VALUES ('779','20','28','Seorang Perempuan berusia 38 tahun datang bersama suaminya untuk memasang alat\nkontrasepsi.sebenarnya perempuan tersebut tidak ingin berKB dan ingin punya anak.tetapi\nSuaminyatidak memperolehkan hamil lagi karena umur perempuan tersebut sudah termasuk\nrisiko tinggi.Bidan memberikan penjelasan kepada perempuan tersebut dan suaminya.si suami\nternyata setuju dengan saran dari bu bidan untuk tidak hamil kembali karena sudah risiko tinggi,\nuntuk menghindari tuntutan hukum sebelum tindakan bidan terlebih dahulu harus\nmelakukan','1','Laporan','Rujukan','Informed consent','Informed choice','','C','','','','','','','');
