INSERT INTO `soal` VALUES ('893','23','3','Apa yang menjadi fokus utama dalam pembuatan antarmuka pengguna yang baik?','1','Hanya kebutuhan teknis','Hanya kebutuhan desain yang menarik','Kreativitas pembuat sistem','Kebutuhan pengguna, analisis sistem, dan kreativitas pembuat sistem','Kebutuhan sistem, analisis user, dan kreativitas mesin','D','','','','','','','');
INSERT INTO `soal` VALUES ('894','23','4','Apa yang dimaksud dengan interface yang \"user-friendly\"?','1','Tampilan yang buruk dan sulit dioperasikan','Tampilan yang menarik dan sulit dipelajari','Tampilan yang bagus/menarik, mudah dioperasikan, mudah dipelajari, dan membuat pengguna merasa nyaman dan senang menggunakan software tersebut','Tampilan yang buruk dan tidak mencakup kebutuhan pengguna','Tampilan yang baik dan tidak mencakup kebutuhan pengguna','C','','','','','','','');
INSERT INTO `soal` VALUES ('895','23','5','Mengapa perlu mempelajari Interaksi Manusia dan Komputer (IMK)?','1','Karena sulit untuk membuat sesuatu yang rumit','Karena mudah untuk membuat sesuatu yang rumit','Karena tidak ada hubungan antara manusia dan komputer','Karena penting untuk menciptakan antarmuka yang baik bagi pengguna','Karena penting untuk menciptakan hubungan yang baik bagi pengguna','D','','','','','','','');
INSERT INTO `soal` VALUES ('896','23','6','Apa yang dimaksud dengan \"Useful, Usable, Used\" dalam konteks antarmuka pengguna?','1','Hanya mempertimbangkan aspek teknis antarmuka','Hanya mempertimbangkan keindahan visual antarmuka','Hanya mempertimbangkan kemudahan penggunaan antarmuka','Memperhitungkan kegunaan, keterpakaiannya, dan seberapa sering antarmuka tersebut digunakan oleh pengguna','Memperhitungkan kegunaan, keterpakaiannya, dan kepuasan pengguna dalam menggunakan antarmuka tersebut','E','','','','','','','');
INSERT INTO `soal` VALUES ('897','23','7','Apa yang menjadi fokus utama dalam perancangan antarmuka pengguna yang efektif?','1','Hanya memperhitungkan aspek teknis','Hanya memperhitungkan aspek desain visual','Hanya memperhatikan kemudahan penggunaan','Memperhitungkan kebutuhan dan preferensi pengguna serta menyediakan pengalaman yang baik bagi pengguna','Memperhitungkan kebutuhan teknis dan estetika visual','D','','','','','','','');
INSERT INTO `soal` VALUES ('898','23','8','Apa yang menjadi tantangan utama dalam merancang antarmuka pengguna yang efisien?','1','Hanya memperhatikan estetika visual','Hanya memperhatikan aspek teknis','Hanya memperhatikan kemudahan penggunaan','Mengakomodasi beragam kebutuhan, keterbatasan, dan preferensi pengguna','Mengurangi interaksi manusia dan komputer menjadi seefisien mungkin','D','','','','','','','');
INSERT INTO `soal` VALUES ('899','23','9','Mengapa studi HCI (Human-Computer Interaction) penting dalam perkembangan teknologi komputer?','1','Karena HCI hanya berkaitan dengan desain visual antarmuka','Karena HCI hanya berkaitan dengan aspek teknis komputer','Karena HCI hanya berkaitan dengan kebutuhan teknis pengguna','Karena HCI membantu memastikan bahwa teknologi komputer dapat digunakan secara efektif dan efisien oleh manusia','Karena HCI hanya berkaitan dengan inovasi dalam pengembangan antarmuka pengguna','D','','','','','','','');
INSERT INTO `soal` VALUES ('900','23','10','Apa yang dimaksud dengan \"Keterlibatan Pengguna\" dalam konteks Interaksi Manusia dan Komputer?','1','Hanya mengamati pengguna tanpa melibatkan mereka dalam proses desain','Hanya mendengarkan keluhan pengguna tanpa bertindak','Mempromosikan partisipasi pengguna dalam proses desain dan pengembangan sistem untuk memastikan kesesuaian dengan kebutuhan mereka','Menyuruh pengguna untuk tidak terlibat dalam proses desain','Mengabaikan pendapat pengguna dalam merancang antarmuka pengguna','C','','','','','','','');
INSERT INTO `soal` VALUES ('901','23','11','Apa yang menjadi salah satu tujuan utama dari Interaksi Manusia dan Komputer (IMK)?','1','Menghasilkan sistem yang rumit dan sulit dioperasikan oleh pengguna','Menciptakan antarmuka yang tidak aman untuk pengguna','Memudahkan manusia dalam mengoperasikan komputer dan mendapatkan umpan balik dari pengguna','Mengurangi efektivitas dan efisiensi kerja pengguna','Mengabaikan kebutuhan psikologis manusia dalam interaksi dengan komputer','C','','','','','','','');
