INSERT INTO `soal` VALUES ('994','25','9','Mengapa studi HCI (Human-Computer Interaction) penting dalam perkembangan teknologi komputer?','1','Karena HCI hanya berkaitan dengan desain visual antarmuka','Karena HCI hanya berkaitan dengan aspek teknis komputer','Karena HCI hanya berkaitan dengan kebutuhan teknis pengguna','Karena HCI membantu memastikan bahwa teknologi komputer dapat digunakan secara efektif dan efisien oleh manusia','Karena HCI hanya berkaitan dengan inovasi dalam pengembangan antarmuka pengguna','D','','','','','','','');
INSERT INTO `soal` VALUES ('995','25','10','Apa yang dimaksud dengan \"Keterlibatan Pengguna\" dalam konteks Interaksi Manusia dan Komputer?','1','Hanya mengamati pengguna tanpa melibatkan mereka dalam proses desain','Hanya mendengarkan keluhan pengguna tanpa bertindak','Mempromosikan partisipasi pengguna dalam proses desain dan pengembangan sistem untuk memastikan kesesuaian dengan kebutuhan mereka','Menyuruh pengguna untuk tidak terlibat dalam proses desain','Mengabaikan pendapat pengguna dalam merancang antarmuka pengguna','C','','','','','','','');
INSERT INTO `soal` VALUES ('996','25','11','Apa yang menjadi salah satu tujuan utama dari Interaksi Manusia dan Komputer (IMK)?','1','Menghasilkan sistem yang rumit dan sulit dioperasikan oleh pengguna','Menciptakan antarmuka yang tidak aman untuk pengguna','Memudahkan manusia dalam mengoperasikan komputer dan mendapatkan umpan balik dari pengguna','Mengurangi efektivitas dan efisiensi kerja pengguna','Mengabaikan kebutuhan psikologis manusia dalam interaksi dengan komputer','C','','','','','','','');
INSERT INTO `soal` VALUES ('997','25','12','Mengapa perancangan antarmuka pengguna yang baik penting dalam pengembangan aplikasi komputer?','1','Karena mengurangi biaya penulisan program','Karena mempersulit penjualan produk','Karena tidak berdampak pada produktivitas','Karena tidak mempengaruhi kepuasan pengguna','Karena tidak meningkatkan kegunaan komputer dalam organisasi','A','','','','','','','');
INSERT INTO `soal` VALUES ('998','25','13','Apa yang dimaksud dengan \"Consistency\" dalam perancangan antarmuka pengguna?','1','Menyesuaikan antarmuka dengan berbagai karakteristik pengguna','Memastikan antarmuka cocok dengan tugas pengguna','Memastikan antarmuka sesuai dengan sistem asli','Memiliki tampilan yang seragam dalam aplikasi yang berbeda','Memastikan antarmuka mudah dipahami oleh pengguna','D','','','','','','','');
INSERT INTO `soal` VALUES ('999','25','14','Mengapa \"Direct Manipulation\" penting dalam perancangan antarmuka pengguna?','1','Karena memungkinkan user untuk mengubah tampilan antarmuka sesuai keinginan','Karena tidak ada pengaruhnya terhadap responsivitas aplikasi','Karena tidak relevan dengan kebutuhan pengguna','Karena membuat antarmuka lebih rumit','Karena tidak mempengaruhi kepuasan pengguna','A','','','','','','','');
INSERT INTO `soal` VALUES ('1000','25','15','Apa arti dari WYSIWYG dalam konteks perancangan antarmuka pengguna?','1','Antarmuka harus sesuai dengan tampilan yang diinginkan oleh pengguna','Antarmuka harus memenuhi semua kebutuhan pengguna','Pengguna harus dapat dengan mudah memanipulasi antarmuka sesuai keinginan','Antarmuka harus responsif terhadap setiap input pengguna','Apa yang terlihat di layar harus sama dengan apa yang akan dihasilkan oleh sistem','E','','','','','','','');
