INSERT INTO `soal` VALUES ('1010','25','25','Mengapa penting memahami Teori Sistem Manusia dan Komputer dalam merancang sistem komputer?','1','Karena tidak ada alternatif lain','Karena ini merupakan bagian dari kurikulum akademik','Karena tidak ada hubungannya dengan pengguna akhir','Karena membantu mempertimbangkan kebutuhan, karakteristik, dan keterbatasan manusia dalam merancang teknologi informasi yang efektif dan ramah pengguna','Karena hanya berkaitan dengan aspek teknis sistem komputer','D','','','','','','','');
INSERT INTO `soal` VALUES ('1011','25','26','Apa yang dimaksud dengan Teori Sistem Manusia?','1','Teori yang mengabaikan faktor manusia dalam sistem','Teori yang hanya fokus pada teknologi komputer','Teori yang menekankan pentingnya memahami manusia sebagai sistem kompleks','Teori yang hanya berfokus pada aspek fisik manusia','Teori yang tidak relevan dengan sistem komputer','C','','','','','','','');
INSERT INTO `soal` VALUES ('1012','25','27','Mengapa penting memahami keterkaitan antara berbagai aspek manusia dalam Teori Sistem Manusia?','1','Karena hal itu tidak memiliki pengaruh signifikan','Karena hanya aspek fisik manusia yang penting','Karena aspek manusia tidak relevan dengan lingkungan sosial dan teknologi','Karena berbagai aspek manusia saling memengaruhi satu sama lain','Karena hanya aspek emosional manusia yang penting','D','','','','','','','');
