INSERT INTO `soal` VALUES ('1014','25','29','Apa langkah pertama dalam integrasi sistem manusia dan komputer?','1','Merancang antarmuka pengguna','Melakukan evaluasi pengguna','Memahami siapa yang akan menggunakan sistem tersebut','Meningkatkan keamanan data pengguna','Melakukan survei tentang teknologi informasi','C','','','','','','','');
