INSERT INTO `soal` VALUES ('1121','28','1','Apa yang dimaksud dengan Interaksi Manusia dan Komputer (IMK)?','1','Studi tentang bagaimana manusia berinteraksi dengan hewan peliharaan','Studi tentang bagaimana manusia berinteraksi dengan alam semesta','Studi tentang bagaimana manusia berinteraksi dengan komputer dalam berbagai konteks','Studi tentang bagaimana komputer berinteraksi dengan komputer lainnya','Studi tentang bagaimana komputer berinteraksi dengan komputer dan mahkluk hidup','C','','','','','','','');
INSERT INTO `soal` VALUES ('1122','28','2','Apa yang menjadi tujuan dari pembelajaran Interaksi Manusia dan Komputer (IMK)?','1','Memahami kebutuhan hanya komputer','Memahami kebutuhan dan preferensi pengguna dalam menggunakan sistem komputer','Memahami kebutuhan komputer saja','Memahami kebutuhan pengguna di luar konteks komputer','Memahami kebutuhan pengguna di dalam konteks komputer','B','','','','','','','');
INSERT INTO `soal` VALUES ('1123','28','3','Apa yang menjadi fokus utama dalam pembuatan antarmuka pengguna yang baik?','1','Hanya kebutuhan teknis','Hanya kebutuhan desain yang menarik','Kreativitas pembuat sistem','Kebutuhan pengguna, analisis sistem, dan kreativitas pembuat sistem','Kebutuhan sistem, analisis user, dan kreativitas mesin','D','','','','','','','');
INSERT INTO `soal` VALUES ('1124','28','4','Apa yang dimaksud dengan interface yang \"user-friendly\"?','1','Tampilan yang buruk dan sulit dioperasikan','Tampilan yang menarik dan sulit dipelajari','Tampilan yang bagus/menarik, mudah dioperasikan, mudah dipelajari, dan membuat pengguna merasa nyaman dan senang menggunakan software tersebut','Tampilan yang buruk dan tidak mencakup kebutuhan pengguna','Tampilan yang baik dan tidak mencakup kebutuhan pengguna','C','','','','','','','');
INSERT INTO `soal` VALUES ('1125','28','5','Mengapa perlu mempelajari Interaksi Manusia dan Komputer (IMK)?','1','Karena sulit untuk membuat sesuatu yang rumit','Karena mudah untuk membuat sesuatu yang rumit','Karena tidak ada hubungan antara manusia dan komputer','Karena penting untuk menciptakan antarmuka yang baik bagi pengguna','Karena penting untuk menciptakan hubungan yang baik bagi pengguna','D','','','','','','','');
INSERT INTO `soal` VALUES ('1126','28','6','Apa yang dimaksud dengan \"Useful, Usable, Used\" dalam konteks antarmuka pengguna?','1','Hanya mempertimbangkan aspek teknis antarmuka','Hanya mempertimbangkan keindahan visual antarmuka','Hanya mempertimbangkan kemudahan penggunaan antarmuka','Memperhitungkan kegunaan, keterpakaiannya, dan seberapa sering antarmuka tersebut digunakan oleh pengguna','Memperhitungkan kegunaan, keterpakaiannya, dan kepuasan pengguna dalam menggunakan antarmuka tersebut','E','','','','','','','');
INSERT INTO `soal` VALUES ('1127','28','7','Apa yang menjadi fokus utama dalam perancangan antarmuka pengguna yang efektif?','1','Hanya memperhitungkan aspek teknis','Hanya memperhitungkan aspek desain visual','Hanya memperhatikan kemudahan penggunaan','Memperhitungkan kebutuhan dan preferensi pengguna serta menyediakan pengalaman yang baik bagi pengguna','Memperhitungkan kebutuhan teknis dan estetika visual','D','','','','','','','');
INSERT INTO `soal` VALUES ('1128','28','8','Apa yang menjadi tantangan utama dalam merancang antarmuka pengguna yang efisien?','1','Hanya memperhatikan estetika visual','Hanya memperhatikan aspek teknis','Hanya memperhatikan kemudahan penggunaan','Mengakomodasi beragam kebutuhan, keterbatasan, dan preferensi pengguna','Mengurangi interaksi manusia dan komputer menjadi seefisien mungkin','D','','','','','','','');
INSERT INTO `soal` VALUES ('1129','28','9','Mengapa studi HCI (Human-Computer Interaction) penting dalam perkembangan teknologi komputer?','1','Karena HCI hanya berkaitan dengan desain visual antarmuka','Karena HCI hanya berkaitan dengan aspek teknis komputer','Karena HCI hanya berkaitan dengan kebutuhan teknis pengguna','Karena HCI membantu memastikan bahwa teknologi komputer dapat digunakan secara efektif dan efisien oleh manusia','Karena HCI hanya berkaitan dengan inovasi dalam pengembangan antarmuka pengguna','D','','','','','','','');
INSERT INTO `soal` VALUES ('1130','28','10','Apa yang dimaksud dengan \"Keterlibatan Pengguna\" dalam konteks Interaksi Manusia dan Komputer?','1','Hanya mengamati pengguna tanpa melibatkan mereka dalam proses desain','Hanya mendengarkan keluhan pengguna tanpa bertindak','Mempromosikan partisipasi pengguna dalam proses desain dan pengembangan sistem untuk memastikan kesesuaian dengan kebutuhan mereka','Menyuruh pengguna untuk tidak terlibat dalam proses desain','Mengabaikan pendapat pengguna dalam merancang antarmuka pengguna','C','','','','','','','');
INSERT INTO `soal` VALUES ('1131','28','11','Apa yang menjadi salah satu tujuan utama dari Interaksi Manusia dan Komputer (IMK)?','1','Menghasilkan sistem yang rumit dan sulit dioperasikan oleh pengguna','Menciptakan antarmuka yang tidak aman untuk pengguna','Memudahkan manusia dalam mengoperasikan komputer dan mendapatkan umpan balik dari pengguna','Mengurangi efektivitas dan efisiensi kerja pengguna','Mengabaikan kebutuhan psikologis manusia dalam interaksi dengan komputer','C','','','','','','','');
INSERT INTO `soal` VALUES ('1132','28','12','Mengapa perancangan antarmuka pengguna yang baik penting dalam pengembangan aplikasi komputer?','1','Karena mengurangi biaya penulisan program','Karena mempersulit penjualan produk','Karena tidak berdampak pada produktivitas','Karena tidak mempengaruhi kepuasan pengguna','Karena tidak meningkatkan kegunaan komputer dalam organisasi','A','','','','','','','');
INSERT INTO `soal` VALUES ('1133','28','13','Apa yang dimaksud dengan \"Consistency\" dalam perancangan antarmuka pengguna?','1','Menyesuaikan antarmuka dengan berbagai karakteristik pengguna','Memastikan antarmuka cocok dengan tugas pengguna','Memastikan antarmuka sesuai dengan sistem asli','Memiliki tampilan yang seragam dalam aplikasi yang berbeda','Memastikan antarmuka mudah dipahami oleh pengguna','D','','','','','','','');
INSERT INTO `soal` VALUES ('1134','28','14','Mengapa \"Direct Manipulation\" penting dalam perancangan antarmuka pengguna?','1','Karena memungkinkan user untuk mengubah tampilan antarmuka sesuai keinginan','Karena tidak ada pengaruhnya terhadap responsivitas aplikasi','Karena tidak relevan dengan kebutuhan pengguna','Karena membuat antarmuka lebih rumit','Karena tidak mempengaruhi kepuasan pengguna','A','','','','','','','');
INSERT INTO `soal` VALUES ('1135','28','15','Apa arti dari WYSIWYG dalam konteks perancangan antarmuka pengguna?','1','Antarmuka harus sesuai dengan tampilan yang diinginkan oleh pengguna','Antarmuka harus memenuhi semua kebutuhan pengguna','Pengguna harus dapat dengan mudah memanipulasi antarmuka sesuai keinginan','Antarmuka harus responsif terhadap setiap input pengguna','Apa yang terlihat di layar harus sama dengan apa yang akan dihasilkan oleh sistem','E','','','','','','','');
INSERT INTO `soal` VALUES ('1136','28','16','Karakteristik manakah yang memungkinkan sistem untuk menyesuaikan diri dengan keinginan pengguna?','1','Inisiatif','Konsistensi','Keluwesan','Beban informasi','Observabilitas','C','','','','','','','');
